import React, { Component } from "react";

class Selector extends React.Component {
  render() {
    const { id, lab, opt1, opt2 } = this.props.selector;
    // console.log(lab + id);
    return (
      <div>
        <span className="me-2">{lab} </span>
        <div className="w-100 buttons has-addons is-fullwidth">
          <input
            type="radio"
            name={lab}
            className="btn-check"
            id={opt1}
            autoComplete="off"
            defaultChecked
          />
          <label
            className="button is-primary is-outlined is-fullwidth"
            htmlFor={opt1}
          >
            {opt1}
          </label>
          <input
            type="radio"
            name={lab}
            className="btn-check"
            id={opt2}
            autoComplete="off"
          />
          <label
            className="button is-primary is-outlined is-fullwidth"
            htmlFor={opt2}
          >
            {opt2}
          </label>
        </div>
      </div>
    );
  }
}

export default Selector;
